import React, { Component } from "react";
import a from "./images/a.jpeg";
import b from "./images/b.jpeg";
import c from "./images/c.jpeg";
import d from "./images/d.jpeg";
import e from "./images/e.jpeg";
import Card from "./Card";

class Shop extends Component {
  state = {
    cards: [
      {
        id: 0,
        nome: "Valigia a ",
        prezzo: 1.99,
        immagine: a,
      },
      {
        id: 0,
        nome: "Valigia a ",
        prezzo: 1.99,
        immagine: a,
      },
      {
        id: 0,
        nome: "Valigia a ",
        prezzo: 1.99,
        immagine: a,
      },
      { id: 0, nome: "Valigia a ", prezzo: 1.99, immagine: a },
      {
        id: 0,
        nome: "Valigia a ",
        prezzo: 1.99,
        immagine: a,
      },
    ],
  };

  render() {
    return (
      <div>
        <h2>Shop</h2>
        <h3>Our new products</h3>
        <div className="row">
          {this.state.cards.map((card) => (
            <Card card={card}></Card>
          ))}
        </div>
      </div>
    );
  }
}

export default Shop;
